		"text": "파양되서 돌아온 진희가 가족을 찾아요.\n진도믹스들이 털 복실복실한 개들에 비해 깜찍함 같은건 덜 할지도 몰라요.\n하지만 같이 지내다보면 속이 참 깊고 의젓한 모습에 자꾸 정이 간답니다.\n진희는 어린 나이도 아니고 힘든 일도 많이 있었으니 그 속이 얼마나 깊고 어두울까요.\n진희를 봐주세요. https://t.co/4XEo7ci9Ka"
